;; **
;;; ## Make network from spec
;; **

;; @@
(defn make-network
  "Xavier initialization"
  [spec]
  (let [net-shapes (concat [(:in spec)]
                           (:hidden spec)
                           [(:out spec)])
        weight-shapes (partition 2 1 net-shapes)
        bias-shapes (map (comp list second) weight-shapes)
        layers (map
                 (fn [w b]
                   {:weights (random-matrix w (Math/sqrt (/ 2 (reduce + w))))
                    :biases (random-matrix b 0)})
                 weight-shapes
                 bias-shapes)
        layers (mapv
                 (fn [vars]
                   {:vars vars
                    :pass {:forward fc-relu-forward :backward fc-relu-backward}})
                 layers)
        layers (conj (vec (butlast layers))
                     {:vars (:vars (last layers))
                      :pass {:forward fc-forward :backward fc-backward}})]
    layers))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/make-network</span>","value":"#'radioactive-winds/make-network"}
;; <=

;; **
;;; ## Network Forward
;; **

;; @@
(defn network-logits
  "Returns: {:out [N, outputs], :caches [list-of-caches]}"
  [network batch]
  (reduce
    (fn [state layer]
      (let [{vars :vars pass :pass} layer
            {forward :forward} pass
            {out :out cache :cache} (forward (:out state) vars)]
        {:out out
         :caches (conj (:caches state) cache)}))
    {:out batch
     :caches []}
    network))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/network-logits</span>","value":"#'radioactive-winds/network-logits"}
;; <=

;; @@
(defn network-predict
  [network batch]
  (let [logits (:out (network-logits network batch))]
    (mapv (fn [row]
            (apply max-key
                   #(nth row %)
                   (range (count row))))
          logits)))

(defn network-accuracy
  [network batch labels]
  (let [preds (network-predict network batch)]
    (/ (count (filter #(apply = %)
                      (map list
                           labels
                           preds)))
       (float (count labels)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/network-accuracy</span>","value":"#'radioactive-winds/network-accuracy"}
;; <=

;; **
;;; ## Network Backward
;;; including forward and backward loss
;; **

;; @@
(defn reg-loss
  [network reg-strength]
  (let [reg_loss (* reg-strength
                    (reduce + (map
                                #(cm/esum (cm/pow % 2))
                                (map #(:weights (:vars %)) network))))]
    reg_loss))

(defn grads-from-logits
  [network forward-output labels reg-strength]
  (let [{logits :out, caches :caches} forward-output
        {data-loss :out
         {logit-grad :logit-grad} :cache} (softmax-log-loss logits labels)
        total-loss (+ data-loss (reg-loss network reg-strength))
        {input-grad :grad-in
         grads :grad-vars} (reduce
                             (fn [grads [back cache]]
                               (let [{gout :grad-in all-gv :grad-vars} grads
                                     {gin :grad-in gv :grad-vars} (back gout cache)]
                                 {:grad-in gin
                                  :grad-vars (cons gv all-gv)}))
                             {:grad-in logit-grad :grad-vars '()}
                             (reverse
                               (map vector
                                    (map #(:backward (:pass %)) network)
                                    caches)))
        grads (mapv
                (fn [g w]
                  (update-in g [:weights] #(cm/add % (cm/mul (* 2 reg-strength) (cm/pow w 2)))))
                grads
                (map #(:weights (:vars %)) network))]
    {:grads grads
     :loss total-loss}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/grads-from-logits</span>","value":"#'radioactive-winds/grads-from-logits"}
;; <=

;; **
;;; ## Gradient Check (all is good)
;; **

;; @@
(defn grad-check
  [network batch labels]
  (let [h 1e-10
        f #(grads-from-logits %
                              (network-logits % batch)
                              labels 0)
        {fx :loss
         grads :grads} (f network)]
    (for [i (range (count network))]
      (let [w [i :vars :weights 0 0]
            b [i :vars :biases 0]
            w_grad (get-in grads [i :weights 0 0])
            b_grad (get-in grads [i :biases 0])
            w_num (/ (- (:loss (f (update-in network w (partial + h)))) fx) h)
            b_num (/ (- (:loss (f (update-in network b (partial + h)))) fx) h)]
        {:b (vector b_num b_grad)
         :w (vector w_num w_grad)}))))

(defn run-grad-check []
  (let [spec {:in 2 :hidden [16 8 4] :out 3}
        net (make-network spec)
        [batch labels] [[[2 -1][-2 -1][3 4]] [0 1 2]]
        results (grad-check net batch labels)]
    (pprint results)))

(run-grad-check)
