;; **
;;; ## Make and train a network
;; **

;; @@
(defn train
  [network training-gen reg-strength learning-rate iterations]
  (reduce
    (fn [{net :net history :history} [batch label]]
      (let [forward (network-logits net batch)
            {grads :grads loss :loss} (grads-from-logits net forward label reg-strength)
            updated-net (mapv

                          (fn [layer grad]
                            (reduce (fn [new-layer var-name]
                                      (update-in new-layer [:vars var-name]
                                                 #(cm/sub % (cm/mul learning-rate
                                                                    (get grad var-name)))))
                                    layer
                                    [:biases :weights]))
                          net grads)]
        {:history (conj history loss)
         :net updated-net}))
    {:net network :history []}
    (take iterations training-gen)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-winds/train</span>","value":"#'radioactive-winds/train"}
;; <=

;; @@
(defn make-model
  ([spec] (make-model spec true))
  ([spec give-plot]
   (let [net (make-network (:architecture spec))
         {net :net
          history :history} (train net
                                   ((:training-generator spec) (:batch-size spec))
                                   (:reg-strength spec)
                                   (:learning-rate spec)
                                   (:iterations spec))
         [data label] (first ((:training-generator spec) 512))
         accuracy (network-accuracy net data label)]
     (println "accuracy on training data:" accuracy)
     (if give-plot
       (plot/list-plot history)
       net))))
